(11, 'Chính chủ cho thuê phòng riêng Chung cư Era Town Đức Khải , Quận 7', 'chinh-chu-cho-thue-phong-rieng-chung-cu-era-town-duc-khai-quan-7', NULL, '<p>Chính chủ cho thuê phòng trọ trong căn hộ Chung cư Era Town Đức Khải.</p><p>Khu chung cư rộng rãi, thoáng mát, an ninh, tiện ích đầy đủ, tổng diện tích hơn 10ha với hơn 3000 căn hộ, cư dân đông đúc, đường xá rộng rãi, thông thoáng kết nối giao thông thuận tiện với các quận, trường học - chợ đi bộ ngay dưới chung cư. Cây xanh và bờ sông bao quanh khu này cực mát nhé</p><p>Phòng 1tr6-2tr tolet dùng chung cho nam hoặc nữ diện tích phòng từ 7-12m2</p><p>Phòng master 18-28m2 tolet riêng giá từ 3tr-3tr6 cửa sổ view thoáng mát.</p><p>Tất cả các phòng đều có tủ lạnh máy giặt bên ngoài sử dụng chung. Khu bếp và ban công giặt phơi rộng rãi.</p><p>Quan tâm LH SĐT hoặc nhắn zalo nếu cần thêm thông tin. Vui lòng đọc kỹ bài đăng .</p><p>Chủ nhà thân thiện, hoà đồng, tâm lý.</p>', 1, 2, 40, 1300000, 2, 3, 3, 0, 32, 73, NULL, 'Phường Đồng Xuân , Quận Hoàn Kiếm , Thành phố Hà Nội', NULL, '2023-11-29 11:28:00', '2023-12-04', 1, 4, 1, '{\"0\":\"21.037613653397752\",\"1\":\"105.84909707234102\"}', 3, NULL, '2023-11-26 19:29:50', '2023-12-01 19:03:01'),
